import "./projects.css"

const Project = () => {
    return (
        <div className="projects">
            <h2>Project Name</h2>
            <img src="img_girl.jpg" alt="Girl in a jacket"></img>
            <text>Description</text>
            <text>Coach: Timothy</text>
            <text>Students:</text>
        </div>
    );
};

export default Project;
